\viewkind4\uc1\pard\ltrpar\sb120\tx220\lang1031\f0\fs20 Von einem Konkubinatspaar sprechen wir, wenn ein Paar:\par
\pard\ltrpar\tx220\par
\b - mind. 2 Jahre zusammen im gleichen Haushalt lebt oder \par
- im gleichen Haushalt lebt und ein gemeinsames (oder mehrere) Kind(er) erzieht.\b0\par
\par
\pard\ltrpar Der Teil des Paares, der nicht Sozialhilfe beantragt, nennen wir \b nichtunterst\''fctzter Konkubinats\-part\-ner (nKp).\b0  Von diesem ben\''f6tigen wir Unterlagen zu den \b regelm\''e4ssigen Einnahmen und zum Ver\-m\''f6\-gen, \b0 sowie Unterlagen zu \b zwingenden Ausgaben\b0  (Steuerrechnungen, Alimentenverpflichtungen, zwingende Erwerbsunkosten, Zusatzversicherung Krankenkasse, etc.\par
}', N'Konkubinat', N'F', NULL, NULL, 1, 0)
