-\tab bei Familiengemeinschaften (z.B. junger Erwachsener ohne Erwerb und berufst\''e4tige Eltern\line\tab oder Geschwister)\par
\par
\b0 Bei der Berechnung der Haushalf\''fchrungsentsch\''e4digung (HHE) beziehen \lang2055 wir die \b regul\''e4ren Einnah\-men sowie das Verm\''f6gen\b0  der PartnerInnen/Verwandten sowie deren \b zwingenden Ausgaben\b0  (ausser Steuer und Erwerbsunkosten) mit ein.\f1\par
}', N'Haushaltführung', N'F', NULL, NULL, 1, 0)
